import Index from "views/Index.js";
import Profile from "views/examples/Profile.js";
import Maps from "views/examples/Maps.js";
import Register from "views/examples/Register.js";
import Login from "views/Login.js";
import Tables from "views/examples/Tables.js";
import Icons from "views/examples/Icons.js";
import Summary from "views/Summary.js";
import Machine from "views/Machine.js";
import Performance from "views/Performance.js";

var routes = [
  {
    path: "/index",
    name: "Dashboard",
    icon: "ni ni-tv-2 text-white",
    component: <Index />,
    layout: "/admin",
  },
  {
    path: "/summary",
    name: "Summary",
    icon: "ni ni-align-center text-white",
    component: <Summary />,
    layout: "/admin",
  },
  {
    path: "/machine",
    name: "Machine",
    icon: "ni ni-settings text-white",
    component: <Machine />,
    layout: "/admin",
  },
  {
    path: "/icons",
    name: "Icons",
    icon: "ni ni-planet text-white",
    component: <Icons />,
    layout: "/admin",
  },
  {
    path: "/maps",
    name: "Maps",
    icon: "ni ni-pin-3 text-orange",
    component: <Maps />,
    layout: "/admin",
  },
  {
    path: "/user-profile",
    name: "User Profile",
    icon: "ni ni-single-02 text-yellow",
    component: <Profile />,
    layout: "/admin",
  },
  {
    path: "/tables",
    name: "Tables",
    icon: "ni ni-bullet-list-67 text-red",
    component: <Tables />,
    layout: "/admin",
  },
  {
    path: "/login",
    name: "Login",
    icon: "ni ni-key-25 text-info",
    component: <Login />,
    layout: "/auth",
  },
  {
    path: "/register",
    name: "Register",
    icon: "ni ni-circle-08 text-pink",
    component: <Register />,
    layout: "/auth",
  },
  {
    path: "/utilization",
    name: "Utilization",
    icon: "ni ni-calendar-grid-58 text-black",
    layout: "/admin",
  },
  {
    path: "/performance",
    name: "Performance",
    icon: "ni ni-watch-time text-white",
    component: <Register />,
    layout: "/admin",
  }
];
export default routes;
